import React from 'react';
import makeStyles from "@material-ui/core/styles/makeStyles";
import Iframe from "react-iframe";
import Grid from "@material-ui/core/Grid";
import Divider from "@material-ui/core/Divider";
import Card from "@material-ui/core/Card";
import orange from "@material-ui/core/colors/orange";
import amber from "@material-ui/core/colors/amber";
import Typography from "@material-ui/core/Typography";
import DualPane from "./DualPane";

const useStyles = makeStyles(theme => ({
    desc_card: {
        minHeight: 100,
        background: orange[50],
        padding: 10
    },
    anec_card: {
        minHeight: 100,
        background: amber[200],
        padding: 10,
        fontWeight: "bold",
        fontFamily: "Garamond"
    },
    grid_text: {
        padding: 20
    },
    subheading: {
        fontFamily: 'Garamond',
        fontWeight: 'bold',
        fontStyle: 'italic',
        textDecoration: 'underline',
        marginBottom: 5
    },
    content: {
        fontFamily: 'Garamond',
        fontSize: 17

    }
}));

export default function Guitar() {
    const classes = useStyles();
    return (
        <div>
            <DualPane url1="https://www.youtube.com/embed/bwVirkXOSz4"
                      url2="https://www.youtube.com/embed/shiSCyZfQlU"
            />

            <Grid className={classes.grid_text} container justify="space-evenly" spacing={3}>
                <Grid item xs={7}>
                    <Card raised className={classes.desc_card}>
                        <Typography variant="h6" align='center' className={classes.subheading}>
                            Background
                        </Typography>
                        <Typography variant='body1' gutterBottom className={classes.content}>
                            <ul>
                                <li> Started learning at age of 12. </li>
                                <li> Mainly self-taught (acoustic and electric), with initial guidance from my older brother. </li>
                                <li> Stemmed from an interest in <i>Classic Rock</i>, but have now
                                    taken interest in other areas like <i> Gypsy Jazz, 70s Rock, and Blues </i></li>
                            </ul>
                        </Typography>
                    </Card>
                </Grid>
                <Grid item xs={5}>
                    <Card raised className={classes.anec_card}>
                        <Typography variant="h6" align='center' className={classes.subheading}>
                            Fun Facts
                        </Typography>
                        <Typography variant='body1' gutterBottom className={classes.content}>
                            I am primarily a right-hander but play a <i><b>left-handed guitar</b></i>!<br/>
                            My older brother was a left-hander, and we had a left-handed guitar at home.
                            I subconsciously picked up the guitar as a lefty for the first time. It was
                            not till later that I realized, but I decided not to change!
                        </Typography>
                    </Card>
                </Grid>
            </Grid>
        </div>
    );
}
